import React from 'react';

import { Container, ContactTitle } from './styles';

export function About() {
  return(
      <Container>
        <ContactTitle>Contato</ContactTitle>

        <form>
          <input type="text" placeholder="Nome"/>
          <input type="text" placeholder="Nome"/>
          <textarea placeholder="Escreva"></textarea>
        </form>
      </Container>
  );
}
